import React, { Component } from 'react'
import NavItem from '../NavItem'

export default class NavList extends Component {

    state = {
        items: [
            {
                id:'1',
                to:'default',
                itemName:'Default'
            }
        ]
    }

    render() {
        return (
            <ul>
                <NavItem {...this.state.items}/>
            </ul>
        )
    }
}
